import styled from 'styled-components';

export const Container = styled.div`
  text-align: center;
  position: relative;
  cursor: pointer;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 5px;
  border-radius: 5px;
  display: block;
  flex: 1 1 0%;
  line-height: 1;
  background: white;
  padding: 20px 0px;
  margin: 30px;
`;
